var init = function(){
    const grpc = require('@grpc/grpc-js');

    const protoLoader = require('@grpc/proto-loader');

    const PROTO_PATH = __dirname +'../../../proto/chat.proto';

    const packageDefinition = protoLoader.loadSync(
      PROTO_PATH, { 
       keepCase: true,
       longs: String,
       enums: String,
       defaults: true,
       oneofs: true,
    });

   const chatProto = grpc.loadPackageDefinition(packageDefinition).chat;

   function main() {
    // Establish connection with the server
    const client = new chatProto.Chat('localhost:500051', grpc.credentials.createInsecure());

    client.UserInfo({
      User : {
        user_id: "test",
      }
    } , function(err, response) {
      console.log('Data:', response); // API response
      console.log(err);
     });

    }
    main();
  }
  exports.init = init;
